★ノースフェイスのハイパフォーマンスレインスーツ！<br>
<br>
●山岳地帯での雨風に対応する、しなやかさと軽さが特徴の上下セットのレインスーツ。<br>
●20デニールのゴアテックスファブリクスを使用し、必要十分な強度と軽さを両立！<br>
●ジャケットのフロントとポケットファスナーには、防水性を高めるフラップを装備！<br>
●シューズを履いたままの着脱を可能にする長めのサイドファスナーを設けたパンツ仕様。<br>
●専用のスタッフバッグ付き。<br>
●高い防風と透湿性でムレ感を抑えるため、レインウェアという枠に留まらず防風シェルとしても活用可能！<br>
<br>
■素材<br>
身生地(表)：ナイロン(コーティング等樹脂加工)100％<br>
身生地(裏)、ウエスト裏：ナイロン100％<br>
内衿、インナーフラップ裏：ポリエステル100％<br>
■企画製造販売元　株式会社ゴールドウィン<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
